import {BrowserRouter, Route, Routes} from "react-router-dom";
import React from "react";
import Registration from "../Auth/Registration";

function Router() {
  return (
    <>
        <BrowserRouter>
            <Route path="/" element={<Registration />} />
        </BrowserRouter>
    </>
  );
}

export default Router;
